import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Login from './components/Login.js';
import './App.css';

function App() {
  return (
    <BrowserRouter>
              <Switch>
                  <Route path="/login" component={Login} />
              </Switch>
          </BrowserRouter>
  );
}

export default App;
